import React from "react";
import styles from './link-header.module.css';




function LinkHeader(props) {
    
    return(
        
        <a className={styles.linkheader}>
            
            <p className="style.text_type_main-default">{props.name}</p>
             
            <props.icon/>
            


        </a>

    )
};

export default LinkHeader;
